import React from "react";

function Intro() {
  return (
    <div className="intro">
      <h2>
        Try by typing for some food or ingredient. You can also add weight in
        grams (eg. "150g ham") otherwise InFiti will display results for 100g by
        default.
      </h2>
    </div>
  );
}

export default Intro;
